import java.math.BigInteger;

public class Padovan_numbers {
    public static void main(String[] args) {
        long n = 1_000_000;
        System.out.println(" MOJE GET");
        long timeStart = System.currentTimeMillis();
        BigInteger value = Get(n);
        long timeStop = System.currentTimeMillis();
        System.out.println("n = " + n + " czas :  "+ (timeStop - timeStart)+ "[ms]");
        System.out.println("P(n) = " + value.toString());

        System.out.println(" GET z CODE WARS");
        timeStart = System.currentTimeMillis();
        int i = new Long(n).intValue();
        value = Get2(i);
        timeStop = System.currentTimeMillis();
        System.out.println("i = " + n + " czas :  "+ (timeStop - timeStart)+ "[ms]");
        System.out.println("P(i) = " + value.toString());


//        System.out.println("P(n-1) = " + Get(n-1).toString());
//        System.out.println("P(n-2) = " + Get(n-2).toString());
//        System.out.println("P(n-3) = " + Get(n-3).toString());
//

    }
    public static BigInteger Get (long power)
    {
        if(power < 3){
            return BigInteger.ONE;
        }

        BigInteger valueN_1 = BigInteger.ONE; // n = 2
        BigInteger valueN_2 = BigInteger.ONE; // n = 1
        BigInteger valueN_3 = BigInteger.ONE; // n = 0
        long number = 3;
        BigInteger valueN = BigInteger.ONE;


        if (power >= 200_000 && power < 500_000){
            number = 200_000;
            valueN =   new BigInteger("");
            valueN_1 = new BigInteger("");
            valueN_2 = new BigInteger("");
            valueN_3 = new BigInteger("");
        }
        if (power >= 500_000 && power < 700_000){
            number = 500_000;
            valueN =   new BigInteger("");
            valueN_1 = new BigInteger("");
            valueN_2 = new BigInteger("");
            valueN_3 = new BigInteger("");
        }
        if (power >= 700_000 && power < 900_000){
            number = 700_000;
            String s1 = "";
            String s2 = "";
            valueN =   new BigInteger(s1 + s2);
            s1 = "";
            s2 = "";
            valueN_1 = new BigInteger(s1 + s2);
            s1 = "";
            s2 = "";
            valueN_2 = new BigInteger(s1 + s2);
            s1 = "";
            s2 = "";
            valueN_3 = new BigInteger(s1 + s2);
        }
        if(power >= 900_000){
            number = 900_000;
            String s1 = "";
            String s2 = "";
            valueN = new BigInteger(s1 + s2);
            s1 = "";
            s2 = "";
            valueN_1 = new BigInteger(s1 + s2);
            s1 = "";
            s2 = "";
            valueN_2 = new BigInteger(s1 + s2);
            s1 = "";
            s2 = "";
            valueN_3 = new BigInteger(s1 + s2);
        }



//        n0, n1, n2 - > n3 = n0 + n1
//        P(n) = P(n-2) + P(n-3)
        while(number <= power){
            valueN = valueN_3.add(valueN_2);
            valueN_3 = valueN_2;
            valueN_2 = valueN_1;
            valueN_1 = valueN;
            number++;
        }


        return valueN;
    }
    public static BigInteger Get2(int n) {

        n = n + 4;
        BigInteger zero = new BigInteger("0");
        BigInteger one = new BigInteger("1");
        BigInteger[][] matrix = { { zero, one, zero }, { zero, zero, one }, { one, one, zero } };
        BigInteger[][] matrixP = matrix;

        while (n >= 1) {
            if (n % 2 ==1) {
                matrixP = multMatrix (matrix, matrixP);
            }
            matrix = multMatrix (matrix, matrix);
            n/=2;
        }

        return matrixP [0][0];
    }

    public static BigInteger[][] multMatrix(BigInteger[][] matrix, BigInteger[][] matrixP) {

        BigInteger[][] rezult = new BigInteger[3][3];
        for (int i = 0; i < 3; i++) {
            for (int j = 0; j < 3; j++) {
                rezult[i][j] = new BigInteger("0");
                for (int x = 0; x < 3; x++) {
                    rezult[i][j] = rezult[i][j].add(matrix[i][x].multiply(matrixP[x][j]));
                }
            }
        }
        return rezult;
    }
}
